import React from 'react';
import { useNavigate} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.css'

const Home = () => {
  const navigate=useNavigate();
  const handleClick=()=>{
    navigate('/userinput')
  }
  return (
    <>
      <div className='h-main'>
      <div className='h-S'><u>Success starts with <br></br>hardworking consultants</u></div>
      <br></br>
      <div><p></p></div>
      <div className='h-t'>TO JOIN OUR SERVICES</div>
      <div className='h-t'>CLICK HERE</div>
        <div>
          <button className='btn'  id='btn-c' type='submit' onClick={handleClick}>JOIN NOW</button>
        </div>
      </div>
      <hr></hr>

    </>
  );
}

export default Home;
